import React from "react";
const Header = (props) => {
  return (
    <>
      <div className="App">
        <div className="Eden">
          <h1>Eden</h1>
        </div>
        <div id="steps">
          {[1, 2, 3, 4].map((val, idx) => {
            return (
              <button
                id={val}
                className="step active"
                onClick={() => props.ComponentToOpen(val)}
              >
                {val}
              </button>
            );
          })}
        </div>
      </div>
    </>
  );
};

export default Header;
